<?php

namespace Database\Seeders;

use Illuminate\Database\Console\Seeds\WithoutModelEvents;
use Illuminate\Database\Seeder;
use App\Models\Platinum;
use App\Models\User;
use Illuminate\Support\Facades\Storage;
use Illuminate\Support\Str;
use Illuminate\Http\File;

class PlatinumSeeder extends Seeder
{
    /**
     * Run the database seeds.
     */
    public function run(): void
    {
        $student = User::firstWhere('email', 'k@k');

        assert($student instanceof User, 'The student was not found');

        $platinum = new Platinum;
        $platinum->user_id = $student->id;
        $platinum->plat_name = 'Jane Doe';
        $platinum->plat_ic = '010101010101';
        $platinum->plat_title = 'Ms.';
        $platinum->plat_gender = 1;
        $platinum->plat_religion = 'Christian';
        $platinum->plat_race = 'Asian';
        $platinum->plat_citizenship = 'American';
        $platinum->plat_photo = $this->upload('user_photos', 'public', 'png',
        '');

        $platinum->plat_address = '123 Main St';
        $platinum->plat_address2 = 'Apt 4B';
        $platinum->plat_city = 'New York';
        $platinum->plat_state = 'NY';
        $platinum->plat_postcode = '10001';
        $platinum->plat_country = 'USA';
        $platinum->plat_phone_no = '1234567890';
        $platinum->plat_email = 'jane.doe@example.com';
        $platinum->plat_fbname = 'janedoe';
        $platinum->plat_cur_edu_level = 'Bachelor';
        $platinum->plat_edu_field = 'Computer Science';
        $platinum->plat_edu_institute = 'NYU';
        $platinum->plat_occupation = 'Software Engineer';
        $platinum->plat_study_sponsor = 'Parents';
        $platinum->plat_discover_type = 'Friends';
        $platinum->plat_prog_interest = 1;
        $platinum->plat_batch = '2024';
        $platinum->plat_has_referral = 1;
        $platinum->plat_referral_name = 'John Smith';
        $platinum->plat_referral_batch = '2023';
        $platinum->plat_tshirt = 'M';
        $platinum->plat_app_confirm = 1;
        $platinum->plat_app_confirm_date = '2024-06-21';
        $platinum->plat_payment_type = 1;
        $platinum->plat_payment_proof = $this->upload('user_files', 'public', 'pdf',
        '');

        $platinum->save();
    }

    private function upload($directory, $visibility, $extension, $base64)
    {
        $binaryData = base64_decode($base64);

        $tempFilePath = sys_get_temp_dir() . '/' . Str::random(10) . '.' . $extension;
        file_put_contents($tempFilePath, $binaryData);

        $filePath = Storage::putFile($directory, new File($tempFilePath), $visibility);
        assert($filePath !== false, 'Can\'t upload this ' . $extension . ' file.');
        return $filePath;
    }
}
